import React, { Component } from "react";
import ArrowDownwardOutlinedIcon from "@mui/icons-material/ArrowDownwardOutlined";
import "./TrangChu.css";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
export default class TrangChu extends Component {
  render() {
    const data = [
      {
        name: "Page A",
        uv: 4000,
        pv: 2400,
        amt: 2400,
      },
      {
        name: "Page B",
        uv: 3000,
        pv: 1398,
        amt: 2210,
      },
      {
        name: "Page C",
        uv: 2000,
        pv: 9800,
        amt: 2290,
      },
      {
        name: "Page D",
        uv: 2780,
        pv: 3908,
        amt: 2000,
      },
      {
        name: "Page E",
        uv: 1890,
        pv: 4800,
        amt: 2181,
      },
      {
        name: "Page F",
        uv: 2390,
        pv: 3800,
        amt: 2500,
      },
      {
        name: "Page G",
        uv: 3490,
        pv: 4300,
        amt: 2100,
      },
    ];
    let demoUrl = "https://codesandbox.io/s/simple-line-chart-kec3v";
    return (
      <>
        <div className="container">
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
        </div>
        <LineChart
          width={600}
          height={300}
          data={data}
          margin={{ top: 5, right: 20, bottom: 5, left: 0 }}
        >
          <Line type="monotone" dataKey="uv" stroke="#8884d8" />
          <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
        </LineChart>
      </>
    );
  }
}
